  const nextVariant = () => {
    props.setValue(arrayLooper(props.data, props.value));
    console.log(props.value)
  };

  return (
    <ButtonOption onClickHandler={nextVariant}>
      {`${props.value.dimensions[0]}" x ${props.value.dimensions[1]}"`}
    </ButtonOption>
  );
};

